import '../Login.css';

const Login = () => {
    <div className="login">
        <form>
            <input type="text" name="username" placeholder="User name" />
            <input type="password" name="password" placeholder="User name" />
            <button className="btn">Login</button>
        </form>
    </div>
}

export default Login;
